mapper.select:

select * from t_sjjianchu
WHERE 1=1

	 AND sjjianchuDate >= #{sdate,jdbcType=TIMESTAMP} 


	 AND sjjianchuDate <= #{edate,jdbcType=TIMESTAMP} 


	 AND sjjianchuDate1 >= #{sdate1,jdbcType=TIMESTAMP} 


	 AND sjjianchuDate1 <= #{edate1,jdbcType=TIMESTAMP} 



		 AND sjjianchuName LIKE  '%${sjjianchu.sjjianchuName}%' 


		 AND sjjianchuId = #{sjjianchu.sjjianchuId} 


		 AND sjjianchuType = #{sjjianchu.sjjianchuType} 


		 AND sjjianchuType1 = #{sjjianchu.sjjianchuType1} 


		 AND sjjianchuType2 = #{sjjianchu.sjjianchuType2} 


		 AND sjlaiyuanId = #{sjjianchu.sjlaiyuanId} 


		 AND sjqitaId = #{sjjianchu.sjqitaId} 


		 AND shujuId = #{sjjianchu.shujuId} 


		 AND sjleixingId = #{sjjianchu.sjleixingId} 


		 AND sjxingtaiId = #{sjjianchu.sjxingtaiId} 


		 AND yonghuId = #{sjjianchu.yonghuId} 


		 AND byumenId = #{sjjianchu.byumenId} 


		 AND yhroleId = #{sjjianchu.yhroleId} 


		 AND byuyuanId = #{sjjianchu.byuyuanId} 


		 AND byuzhiId = #{sjjianchu.byuzhiId} 


		 AND userId = #{sjjianchu.userId} 


		 AND bumenId = #{sjjianchu.bumenId} 


		 AND buyuanId = #{sjjianchu.buyuanId} 


		 AND buzhiId = #{sjjianchu.buzhiId} 


		 AND roleId = #{sjjianchu.roleId} 


order by sjjianchuId 

	limit #{page},#{rows}
